(9,	'VojtsiXS0L',	'kywmdsSkV2',	'Sample test',	'<h2 style=\"text-align:center\">Why Invest in Birmingham</h2>\r\n\r\n<p>Birmingham, the UK&#39;s second-largest city, has seen a remarkable transformation in recent years. The city has undergone significant regeneration, which has resulted in an increase in property prices, making it a prime location for property investment. Firstly, the city is well connected, with excellent transport links, including a direct rail link to London, making it a popular destination for commuters. Additionally, the city is home to a world-class airport, which attracts international business and tourism.</p>\r\n\r\n<p>Secondly, Birmingham has a diverse and growing economy, making it an attractive place to invest. The city has a large number of multinational companies based there, such as HSBC, Jaguar Land Rover and Deutsche Bank. Additionally, the city has a thriving tech scene, with companies such as Gymshark and Monzo having offices there. With many large-scale developments taking place, such as the &pound;1.5 billion Smithfield development, which will include a new market, residential and commercial units, the city&#39;s economic prospects are looking very positive.</p>\r\n\r\n<p>Lastly, Birmingham has a young and diverse population, making it a vibrant and culturally rich city. The city&#39;s five universities attract students from all over the world, many of whom choose to stay in the city after graduation, driving demand for rental properties. The city also boasts a thriving arts and culture scene, with attractions such as the Birmingham Museum and Art Gallery, the Symphony Hall, and the Birmingham Hippodrome, which attract visitors from across the UK and beyond.</p>\r\n\r\n<p><img alt=\"\" src=\"https://portal.baroncabot.com/storage/photos/9/Y4BEuj0041.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Key Facts</h3>\r\n\r\n<ul>\r\n	<li>10,000 sq ft of commercial space</li>\r\n	<li>Residents&rsquo; courtyard garden</li>\r\n	<li>Opulent reception foyer and concierge desk</li>\r\n	<li>Residents&rsquo; gym, club lounge and screening room</li>\r\n	<li>999 Year Lease</li>\r\n	<li>&pound;0 Ground Rent</li>\r\n</ul>\r\n\r\n<p><img alt=\"\" src=\"https://portal.baroncabot.com/storage/photos/9/dfsdfsdf.PNG\" style=\"width:100%\" /></p>\r\n\r\n<h2 style=\"text-align:center\">Best Unit for you</h2>\r\n\r\n<p>This stunning third-floor property boasts an abundance of natural light, creating a bright and spacious living environment. With two equally sized bedrooms and two equally sized bathrooms, it is perfect for couples, friends, or small families. The contemporary design and high-quality finishes throughout the property provide a modern and luxurious feel. Its prime location offers easy access to local amenities and transport links, making it the perfect home for those looking for convenience and style.</p>\r\n\r\n<p><img alt=\"\" src=\"https://portal.baroncabot.com/storage/photos/9/xxxxxdddd.PNG\" style=\"width:70%\" /></p>\r\n\r\n<h2>Next Steps</h2>\r\n\r\n<p>Have a look through some of the images and the cash flow. On our next call, we can go through this in a bit more detail, where I can explain how the next steps work, and how your mortgage will reduce over the years.&nbsp;</p>\r\n\r\n<p>The next zoom call should be quite an interesting one for you as we get into a bit more detail into the local area, cash flows, and the process for you buying a property in the UK.</p>\r\n\r\n<p>I look forward to speaking with you then.</p>\r\n\r\n<p>Kind regards,</p>\r\n\r\n<p>Jason Tucker&nbsp;</p>',	NULL,	NULL,	'JbhBUSLMatrqAdQnNOTlfCMhNn2cyI',	NULL,	'VyS8hWFmNPb3hnMF6Gt4',	NULL,	'2023-03-26 19:10:47',	'2023-03-26 19:10:47'),
(10,	'T4dUrYsxJ4',	'ryrVL36pnM',	'Pavilion',	'<h2><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">Great to speak about the property options in the UK. One of the best you can look at for your investment needs is this one below in one of the most premium and up-and-coming areas of Manchester/ Salford.</span></span></h2>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">Have a look and let me know what you think.</span></span></p>\r\n\r\n<h2><span style=\"font-family:Tahoma,Geneva,sans-serif\">Why Manchester/ Salford for investors?</span></h2>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">Location is everything with investment. The goal is to get the maximum out of every pound invested, which means investing in places where there is more demand than supply and growing wealth to compete driving up rental prices and property values.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">One of the greatest cities for investments is Manchester, and within Manchester there are few locations better than where Pavilion Wharf at the south of the city.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">While most parts of the city will generate you a great investment return the south of the city centre is the most popular due to the lower prices and faster growth than the very centre, plus the tram and train links that the North, East and West of the city don&rsquo;t have.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">This is why the biggest new developments are here, such as Elizabeth Tower and Deansgate Square where apartments go from &pound;400,000 to several million for penthouses, or Rivergate development where by &pound;500,000 will buy you a luxury apartment.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">Pavilion Wharf, a luxury development minutes walk from these sound like a bargain with available units discounted for early investors between &pound;325,000 up to &pound;385,000 for a 3 bedroom river facing property.</span></p>\r\n\r\n<h2><span style=\"font-family:Tahoma,Geneva,sans-serif\">Why is the Castlefield border part of the city so important?</span></h2>\r\n\r\n<p><img alt=\"\" src=\"https://portal.baroncabot.com/storage/photos/9/pavilion1.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">The immediate area in which Pavilion Wharf sits is high up overlooking the River Irwell, a place where tenants can watch Trafford and Agecroft rowing club race each other, and the barge trips pass by.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">An economically significant spot with tenants easy walking distance to the central business district of Spinningfields, home of Royal Bank of Scotland, Deloitte and HSBC along with some of the best restaurants in the world including The Ivy &ndash; the award-winning celebrity hot spot, as long as the other notable award-winning restaurants Tattu, The Alchemist and Australasia.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">To go further afield Salford Quays light rail tram station is a 9-minute walk, and Cornbrook is 11 minutes away. Deansgate Train station is a 7-minute bike ride or 15-minute walk to take a train to London, Edinburgh, Birmingham and virtually every other city in the UK.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">For international travellers, Manchester International Airport connects Manchester to Australasia, the Middle East, Africa, and the Americas.</span></p>\r\n\r\n<h2><span style=\"font-family:Tahoma,Geneva,sans-serif\">Why is this development so important?</span></h2>\r\n\r\n<p><img alt=\"\" src=\"https://portal.baroncabot.com/storage/photos/9/pavilion2.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">One of the main reasons &ndash; is luxury at almost 25% cheaper than its neighbours!</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">Pavilion Wharf is a development being built by Domis one of the biggest contractors in Manchester, owned by Billionaire Fred Done and behind some of the most notable projects in Manchester such as Blackfriars, plus the million pounds starting price property &lsquo;One Cluny Mews&rsquo; in Kensington &amp; Chelsea.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">The property itself comprises one, two and three-bedroom contemporary apartments including stunning penthouses all designed to the highest standard to provide residents with luxury waterside living. Fully integrated kitchen appliances and white goods are included in the apartments as standard.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">The ground floor offers a concierge and gymnasium amenities demanded by the highest-paying tenants in the city.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">Demand for the property is further driven by a resident&#39;s lounge, perfect for tenants who work from home some days of the week. The wood effect flooring throughout the kitchen and living area creates a luxurious feeling, while being hard-wearing for longevity, with a huge amount of natural light from the large floor-to-ceiling double-glazed windows.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">Integrated appliances and High quality manufactured contemporary fitted kitchen units in the kitchen, plus premium sanitary ware and tiles in the bathroom finish off the premium feel. Secure electronic access, CCTV in all common areas, externally and linked to every apartment, tenants feel fully protected.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">Protection on the structure is even tighter with a 10-year structural warranty, while the developer Forshaw&rsquo;s stamp of quality build will be felt throughout.</span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\">With rental yields starting around 5%, rental growth increasing around 4% per year, and 98.5% occupancy rate investors will highly profitable returns for 100&rsquo;s of years.</span></p>\r\n\r\n<h2><span style=\"font-family:Tahoma,Geneva,sans-serif\">Key Points</span></h2>\r\n\r\n<ul>\r\n	<li>999-year lease,</li>\r\n	<li>1, 2 &amp; 3 bedroom apartments</li>\r\n	<li>Concierge, Residents Lounge, Business Centre and Gymnasium.</li>\r\n	<li>Contemporary design &amp; highly refined specifications.</li>\r\n	<li>Stunning river and city views</li>\r\n	<li>9-minute walk to Deansgate &amp; Castlefield (Manchester Metrolink)</li>\r\n	<li>Easy access to Media City</li>\r\n	<li>Nearby open green parks and recreation spaces</li>\r\n	<li>Close proximity to the University of Manchester &amp; Manchester Metropolitan University</li>\r\n</ul>',	NULL,	NULL,	'072TqbRo506V83dACN2yOElBN0orcF',	NULL,	'VyS8hWFmNPb3hnMF6Gt4',	NULL,	'2023-03-29 09:28:17',	'2023-03-29 09:28:17'),
(11,	'fj0X35pGnZ',	'U9TT7hHTQS',	'Gunsmith House',	'<p>Hi</p>\r\n\r\n<p>It was great to speak to you about your investment options and some of the interesting options I have for you.</p>\r\n\r\n<p>Below is one of our investments that I think would be perfect for your investment criteria.</p>\r\n\r\n<h3>Why Birmingham?</h3>\r\n\r\n<p>Birmingham is a city that has undergone tremendous growth and transformation in recent years. It is now considered one of the UK&#39;s most vibrant and dynamic cities, attracting businesses, investors, and young professionals from all over the world.</p>\r\n\r\n<p>The city is home to some of the world&#39;s largest corporations, including HSBC, PwC, Deloitte, and KPMG, and is a hub for business and commerce. The city&#39;s thriving economy has led to a steady increase in average salaries, with figures from ONS indicating an average salary of over &pound;29,000 per annum.</p>\r\n\r\n<p>Birmingham&#39;s property market is also attractive for investors, with property prices around 6-7 times the average salary, significantly lower than other major cities such as London. The lower property prices provide ample room for rental and capital growth, making it an excellent location for property investment.</p>\r\n\r\n<p>Birmingham is known for its diverse and exciting food scene, with a range of world-class restaurants and cafes catering to all tastes and budgets. The city also has a rich cultural heritage, with a variety of museums, galleries, and historical sites that offer endless opportunities for exploration and learning.</p>\r\n\r\n<p>The demand for property investments in Birmingham is growing rapidly, with new developments in central locations in high demand. Despite land availability being limited, many investors are seeing high occupancy rates of over 98%, indicating the potential for strong returns on investment.</p>\r\n\r\n<p>In summary, Birmingham is a vibrant and dynamic city with a growing economy, diverse food scene, rich cultural heritage, and a thriving property market that offers excellent opportunities for rental and capital growth.</p>\r\n\r\n<h3>Why The Gun Quarter</h3>\r\n\r\n<p><img alt=\"\" src=\"https://portal.baroncabot.com/storage/photos/9/Screenshot 2023-03-15 at 14-41-09 Gunsmith_House_Brochure.pdf.png\" style=\"width:100%\" /></p>\r\n\r\n<p>The Gun Quarter in Birmingham is a historic area of the city that was once the heart of the city&#39;s gun manufacturing industry. Today, it is a thriving residential area with a rich cultural heritage and a range of amenities that make it an attractive location for living.</p>\r\n\r\n<p>One of the main reasons why the Gun Quarter is a great place to live is its central location. The area is located just a short walk from Birmingham city center, giving residents easy access to all the amenities and attractions that the city has to offer.</p>\r\n\r\n<p>One of the main reasons why the Gun Quarter is a great place to live is its central location. The area is located just a short walk from Birmingham city center, giving residents easy access to all the amenities and attractions that the city has to offer.</p>\r\n\r\n<p>Another key benefit of living in the Gun Quarter is the area&#39;s rich cultural heritage. The Gun Quarter has a fascinating history that dates back to the 17th century, and there are many historic buildings and landmarks in the area that offer a glimpse into this heritage. For example, the Grade II-listed Argent Centre is a former factory that has been converted into a vibrant hub for creative industries, while the Birmingham Proof House is a historic building that has been in continuous use since the 19th century.</p>\r\n\r\n<p>In recent years, the Gun Quarter has also undergone significant redevelopment, with a range of new residential properties and amenities being built in the area. This has helped to make the Gun Quarter an increasingly desirable location for young professionals and families looking for high-quality accommodation in the heart of the city.</p>\r\n\r\n<p>Furthermore, the Gun Quarter is an area that is steeped in creativity and innovation. Many artists, designers, and entrepreneurs have set up shop in the area, attracted by its rich history and unique character. This has helped to create a vibrant and dynamic community that is both welcoming and inclusive.</p>\r\n\r\n<p>Overall, the Gun Quarter in Birmingham is an area that offers a unique blend of history, culture, and innovation, making it a great place to live for anyone looking for a high-quality urban lifestyle.</p>\r\n\r\n<h3>Why Gunsmith House</h3>\r\n\r\n<p><img alt=\"\" src=\"https://portal.baroncabot.com/storage/photos/9/FUFGbointernal_02.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>Gunsmith House is a unique blend of old and new, with its historic design seamlessly blending in with the surrounding area. The building boasts a New York loft style, featuring industrial high ceilings and large windows that flood the space with natural light. This exceptional design has made Gunsmith House a popular choice for investors, owners, and tenants alike, with many on the waiting list to secure their spot.</p>\r\n\r\n<p>One of the key features of Gunsmith House is its central courtyard, which offers tenants a peaceful oasis in the heart of the city. This highly sought-after city center living feature provides a perfect spot to enjoy a coffee, mingle with other tenants, or allow the children to play.</p>\r\n\r\n<p>Attention to detail is evident in every aspect of Gunsmith House, including the art piece on the building&#39;s rooftop, which not only adds an intriguing point of interest but also makes it a prime investment opportunity for savvy investors.</p>\r\n\r\n<p><img alt=\"\" src=\"https://portal.baroncabot.com/storage/photos/9/Screenshot 2023-03-15 at 14-34-05 Gunsmith_House_Brochure.pdf.png\" style=\"width:100%\" /></p>\r\n\r\n<ul>\r\n	<li>1 &amp; 2 bedroom apartments including 3 large split-level feature apartments</li>\r\n	<li>Large double bedrooms and own bathrooms for each bedroom</li>\r\n	<li>Balcony and Parking Spaces with selected units</li>\r\n	<li>Short walk to city centre and stations (Grand Central, JQ, Moor St, future HS2)</li>\r\n	<li>Location and design to retain long term tenants</li>\r\n	<li>Private gated landscaped resident&rsquo;s gardens and seating areas\r\n	<ul>\r\n		<li>Completes Q1/Q2 2024</li>\r\n		<li>&pound;5,000 reservation</li>\r\n		<li>20% on exchange remainder on completion</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>',	NULL,	NULL,	'25zKjkaY1gzfmHsEj1H2sNpG6vILIi',	NULL,	'tyxt8rJfopcckFlbg3cA',	NULL,	'2023-03-29 11:33:09',	'2023-03-29 11:33:09'),
