(61,	NULL,	NULL,	'3aXii6b5LLCkgwkxijcu19AMOFNTdJ',	'Northill Apartments',	'Completed',	'Apartments',	'Yes',	NULL,	'Salford Quays, Manchester',	'Studios, 1, 2 and 3 beds',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'137587',	'Simultaneous Exchange and Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2374.744713623707!2d-2.285214884156768!3d53.4730223800057!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x487bae143d1807cf%3A0x42a90b31cc01dfa7!2sFortis%20Quay!5e0!3m2!1sen!2ske!4v1670242893146!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	'30000',	'<p>The brand-new development is comprised of 264 apartments spread over a 27 storey tower, with a selection of spacious studios and premium one, two and three bedroom apartments available.</p>\r\n<p>Each of the stunning apartments will be meticulously designed to the highest possible standard, providing residents with a luxury modern living experience. Facilities will include a landscaped communal garden and an on-site gymnasium to further enhance the rental experience for tenants.</p>\r\n<p>Northill Apartments will be a fantastic addition to this thriving area, which includes MediaCityUK, an iconic modern hub which is home to world-class corporations such as BBC and ITV studios and is at the forefront of the digital economy.</p>\r\n<p>Development Address: Fortis Quays, Salford, MSO 3XZ</p>',	'Available',	'5kTyYCKW.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'486',	'270',	'2',	'20',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	'NORTHILL APARTMENTS, LOCATED IN THE HEART OF SALFORD QUAYS. THE PREVIOUS PHASES HAVE BEEN A TREMENDOUS SUCCESS, SHOWING THE HUGE DEMAND FOR PRIME LUXURY RESIDENTIAL HOMES IN SALFORD.',	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 12:22:08',	'2023-04-03 1