(1198,	NULL,	NULL,	'WsDLVVzFxZv1TMpH3KgpU8z9kxb6qu',	'Swan Courtyard',	'Completed',	'Apartments',	'Yes',	NULL,	'Birmingham',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'171000',	'Simultaneous Exchange and Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d77768.7612117209!2d-1.8847762042827332!3d52.47417831992794!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1s1%20Swan%20Courtyard%2C%20Charles%20Edward%20Road%2C%20Birmingham%20B26%201BU!5e0!3m2!1sen!2ske!4v1679237764200!5m2!1sen!2ske\" width=\"100%\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>The property is within the Swan Courtyard complex, which was built approximately 25 years ago on the site of the historic Swan public house. It fronts directly onto the Coventry Road (A45) at its junction with Yardley Road and Church Road (A4040) approximately 4 miles east of Birmingham City Centre and 4 miles west of Birmingham International Airport, NEC complex and the M42/M6 motorways .</p>\r\n<p>It is also very well located for Solihull to the south and has the benefit of good public transport. The surrounding area is a mixture of commercial and residential users.</p>\r\n<p>The building has a pleasant view to both elevations, providing excellent natural light throughout, with an inner courtyard providing a particularly tranquil setting, with its large swan water feature.</p>\r\n<p>Address: 1 Swan Courtyard, Charles Edward Road, Birmingham B26 1BU</p>',	'Available',	'0DMva7ALveO3DOXU8thGgYbtJIhGbW.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'372',	'270',	'1.11',	'20',	'70',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2023-03-19 14:56:21',	'2023-04-03 10:26:30'),
